/*
=========================================================
* Material Kit 2 React - v2.0.0
=========================================================

* Product Page: https://www.creative-tim.com/product/material-kit-react
* Copyright 2021 Creative Tim (https://www.creative-tim.com)

Coded by www.creative-tim.com

 =========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.
*/

// @mui material components
import Container from "@mui/material/Container";
import Grid from "@mui/material/Grid";

// Material Kit 2 React components
import MKBox from "components/MKBox";
import MKTypography from "components/MKTypography";

// Material Kit 2 React examples
import HorizontalTeamCard from "examples/Cards/TeamCards/HorizontalTeamCard";

// Images
import team1 from "assets/images/team1.jpeg";
import team2 from "assets/images/team2.jpeg";
import team3 from "assets/images/team3.jpeg";
import team4 from "assets/images/team4.jpeg";
import team5 from "assets/images/team5.png";
import team6 from "assets/images/team6.jpg";
import team7 from "assets/images/team7.jpg";

function Team() {
  return (
    <MKBox
      component="section"
      backgroundColor="#ffffff99"
      variant="gradient"
      position="relative"
      py={6}
      px={{ xs: 2, lg: 0 }}
      mx={-2}
    >
      <Container>
        <Grid container>
          <Grid item xs={12} md={8} sx={{ mb: 6 }}>
            <MKTypography variant="h3" color="dark">
              CONVENIOS Y COLABORACIÓN
            </MKTypography>
            <MKTypography variant="body2" color="dark" opacity={0.8}>
              Servicios Medicos SMELS, actualmente tiene convenios con empresas y organizaciones públicas y privadas.
            </MKTypography>
          </Grid>
        </Grid>
        <Grid container spacing={3}>
          <Grid item xs={12} lg={6}>
            <MKBox mb={1}>
              <HorizontalTeamCard
                image={team1}
                name="MC.CARLOS FELIX CONTRERAS"
                position={{ color: "info", label: "NUTRIOLOGO" }}
                description="Contacto: 6181-27-66-37 "
              />
            </MKBox>
          </Grid>
          <Grid item xs={12} lg={6}>
            <MKBox mb={1}>
              <HorizontalTeamCard
                image={team2}
                name="MC.LILIANA BUSTAMANTE"
                position={{ color: "info", label: "PSICÓLOGO" }}
                description="Contacto: 6188-23-14-60"
              />
            </MKBox>
          </Grid>
          <Grid item xs={12} lg={6}>
            <MKBox mb={{ xs: 1, lg: 0 }}>
              <HorizontalTeamCard
                image={team3}
                name="UNIVERSO ÓPTICO"
                position={{ color: "info", label: "OPTOMETRISTA" }}
                description="Contacto:6181-54-52-76"
              />
            </MKBox>
          </Grid>
          <Grid item xs={12} lg={6}>
            <MKBox mb={{ xs: 1, lg: 0 }}>
              <HorizontalTeamCard
                image={team4}
                name="CLINICA SANTA ELENA"
                position={{ color: "info", label: "HOSPITALIZACIÓN" }}
                description="Contacto:"
              />
            </MKBox>
          </Grid>
          <Grid item xs={12} lg={6}>
            <MKBox mb={{ xs: 1, lg: 0 }}>
              <HorizontalTeamCard
                image={team5}
                name="LABORATORIOS RIVERA"
                position={{ color: "info", label: "ESTUDIOS CLÍNICOS" }}
                description="Contacto:6184-54-02-35"
              />
            </MKBox>
          </Grid>
          <Grid item xs={12} lg={6}>
            <MKBox mb={{ xs: 1, lg: 0 }}>
              <HorizontalTeamCard
                image={team6}
                name="CENTRO H&T"
                position={{ color: "info", label: "ULTRASONODO Y DIAGNÓSTICO" }}
                description="Contacto:6181-44-27-38"
              />
            </MKBox>
          </Grid>
          <Grid item xs={12} lg={6}>
            <MKBox mb={{ xs: 1, lg: 0 }}>
              <HorizontalTeamCard
                image={team7}
                name="DENTAREA"
                position={{ color: "info", label: "CLÍNICA DENTAL" }}
                description="Contacto:6188-11-34-16"
              />
            </MKBox>
          </Grid>
        </Grid>
      </Container>
    </MKBox>
  );
}

export default Team;
